import React from "react"

import RegistracijaForm from "./RegistracijaForm"

class Registracija extends React.Component{

    constructor(){
        super()
        this.state = {
            korisnickoIme : "",
            lozinka: "",
            datumRegistracije: new Date(),
            uloga: ""
        }
        this.handleChange = this.handleChange.bind(this)
        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleChange(event){
        const {name, value} = event.target
        this.setState({
            [name]:value
        })
    }

    handleSubmit(e){
        e.preventDefault();

        this.setState({
            datumRegistracije: new Date(),
            uloga: "admin"
        })

        var config={
            dataType: 'json',
            method: 'post',
            body: JSON.stringify(this.state)
          };

        // On submit of the form, send a POST request with the data to the server.
        fetch('http://localhost:8080/bioskop/users',config)
            .then(res => res.json())
            .then(res => console.log(res))

        alert("Uspešno ste se registrovali!")
        window.location.reload();
      }

    render(){
        return(
            <RegistracijaForm  handleChange={this.handleChange} handleSubmit={this.handleSubmit} state={this.state}/>
        )
    }
}

export default Registracija
